import React, {useContext} from 'react'
import {NavLink} from 'react-router-dom'

import classes from '../CSS/NavigationItems.module.css'

// authcontext
import {AuthContext} from '../CONTEXTS/AuthContext'

const navigationItems = () => {
	console.log("AUTH CONTEXT", AuthContext)
	const {login, logout, isLoggedIn} = AuthContext
	return (
		<ul className = {classes.NavigationItems}>
			<li className = {classes.NavigationItem}><NavLink to="/contests" exact>Contests</NavLink></li>
			<li className = {classes.NavigationItem}><NavLink to= "/slots">Slots</NavLink></li>
			<li className = {classes.NavigationItem}><NavLink to= "/winners">Winners</NavLink></li>
			<li className = {classes.NavigationItem}><NavLink to= "/reports">Reports</NavLink></li>
			<li className = {classes.NavigationItem}><NavLink to= "/authentication">Login</NavLink></li>
			<li className = {classes.NavigationItem}><NavLink to= "/logout">Logout</NavLink></li>
		</ul>
	)
}

export default navigationItems;
